import React, { useState, useEffect } from "react";
import {
  Switch,
  Route,
  NavLink,
  Prompt,
  useParams,
  useRouteMatch
} from "react-router-dom";
import "./index.css";

function App({ bookFacade }) {
  return (
    <div>
      <Header />
      <hr />
      <div className="content">
        <Switch>
          <Route exact path="/"></Route>
          <Route path="/jokes">
          <FetchJokes />
          </Route>
          <Route path="/scrape"></Route>
          <Route></Route>
        </Switch>
      </div>
    </div>
  );
}

function Header() {
  return (
    <div>
      <ul className="header">
        <li>
          <NavLink exact activeClassName="active" to="/">
            Home
          </NavLink>
        </li>
        <li>
          <NavLink activeClassName="active" to="/jokes">
            Jokes
          </NavLink>
        </li>
        <li>
          <NavLink activeClassName="active" to="/scrape">
            Scrape
          </NavLink>
        </li>
      </ul>
    </div>
  );
}

function FetchJokes() {

  const [joke, setJoke] = useState({});

  useEffect(() => {
    fetch("http://localhost:8080/securitystarter/api/jokes")
      .then(res => res.json())
      .then(data => {
        console.log(data);
        setJoke(data);
      });
  },[]);

  return (
    <div>
    <p>Click to fetch some jokes!</p>
    <p>Joke 1: {joke.joke1}</p>
    <p>Joke 1 reference: {joke.joke1reference}</p>
    <p>Joke 2: {joke.joke2}</p>
    <p>Joke 2 reference: {joke.joke2reference}</p>
    </div>
  );
}

export default App;
